import './styles.css'; 
import Trash from "./trash.png"

function Card ( { transaction } ) {

    return (

        <div>

        {transaction.type === "Entrada" ?
            (
                <div className='Card-Entrada'>

            <div className='Des-Typ'>
                <div className='Description'>
                    {transaction.description}
                </div>

                <div className='Type'>
                    {transaction.type}
                </div>
            </div>

            <div className='Value'>
                R$ {Number(transaction.value)}
                <button className='Btn-Excluir'>
                <img src={Trash} alt="Lixo Nu Kenzie"/>
                </button>
            </div>

        </div>
            ) : (
                <div className='Card-Saida'>

                <div className='Des-Typ'>
                    <div className='Description'>
                        {transaction.description}
                    </div>

                    <div className='Type'>
                        {transaction.type}
                    </div>
                </div>

                <div className='Value'>
                    R$ {Number(transaction.value)}
                    <button className='Btn-Excluir'>  </button>
                </div>

            </div>
            )
        }
        </div>
    )
}        

export default Card
